window.bookSummaryJSON = "<p><b>Dan Deadman's afterlife just hit an all new low.</b></p> <p>When a suspect explodes mid-interrogation and his office is taken over by an intergalactic despot, undead detective Dan Deadman reckons he's finally hit rock bottom.</p> <p>Banished to a dangerous underground hostel network, Dan becomes embroiled in a mass-murder investigation that will take him from the bowels of Down Here to the depths of the ocean. As the clues run out and the case collapses around him, Dan discovers a sinister plot that could wipe out two whole civilizations, and plunge the planet of Parloo into an endless bloody war.</p> <p>Featuring terrifying sea monsters, killer toilets, and an anatomically correct children's cartoon mascot who'll haunt your nightmares forever, <i>Dead in the Water</i> is the third book in the Dan Deadman Space Detective series and perfect for fans of <i>Space Team</i>, <i>The Dresden Files</i>, and tiny aggressive Irish fellas.</p>"; 
